/* 

crie duas variaveis (a e b) e atribua valores a elas.

troque os valores das variaveis de tal forma que após a troca o valor de a será o valor atribuido a b e o valor de será o valor atribuido a a:

a = b
b = a

*/

let a = 7;
let b = 94;

let x = a;
let y = b;

console.log(a);
console.log(b);

a = y;
b = x;

console.log(a);
console.log(b);